        staker.erc20_approve(address(asset), address(rdToken), mintAmount_);
        staker.rdToken_mint(address(rdToken), mintAmount_);

        rdToken.__setTotalAssets(totalAssets_);

        assertEq(rdToken.previewMint(mintAmount_), totalAssets_);
    }

